import React from 'react';

function Product(props) {
    return (
        <div>
            <h2>{props.name}</h2>
            <p>{props.description}</p>
            <p>Price: ${props.price}</p>
            <button onClick={props.onAddToCart}>Add to Cart</button>
        </div>
    );
}

export default Product;
